    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Hakalau Forest NWR for the next 15 years. This
    plan outlines the Refuge vision and purpose and describes how Hakalau Forest NWR
    will contribute to the overall mission of the Refuge System. The plan provides an
    introduction to the Refuge, an overview of the CCP process, information about the
    physical and biological environment, a summary of the management direction, and
    information about the social and economic environment. Key planning issues include:
    wildlife management, habitat management, public use, cultural resources, climate
    change, coral reefs, and interagency coordination.",nt"license_title": "License
